literals:
padding: ${({ isMdxMode }) => (isMdxMode ? 0 : `${spacing.s40}px 0`)};
  border-bottom: 1px solid #3d4168;
  color: #ffffff;
  font-family: inherit;

height: ${({ height }) => `${height}px`};
  overflow-y: ${({ overflow }) => `${overflow}`};
  transition: height 1s ease;

${({ isMdxMode = true }) =>
    isMdxMode
      ? css`
          padding-bottom: ${spacing.s50}px;
          > *:last-child {
            margin-bottom: 0;
          }
        `
      : ""}
